import { createSlice } from "@reduxjs/toolkit";


const initialState = {}

const trackerSlice = createSlice({
    name:'tracker',
    initialState,
    reducers:{}

})




// export const {  } = trackerSlice.actions
export default trackerSlice.reducer;
